import React, { Component } from "react";

class SearchPixa extends Component {
  // let myUrl = `https://pixabay.com/api/?key=15489555-318fcca1200a48f374a1ce3ea&q=${searchBox}&image_type=photo&pretty=true`
  
  inputSearch = React.createRef()

  render() {
    return (
      <div className="col-lg-6 d-flex justify-content-center mb-4">
        <input ref ={this.inputSearch} type="text" className="form-control w-50 mr-4" />
        <button className="btn btn-info">Search</button>
      </div>
    )
  }
}

export default SearchPixa;
